import React from 'react';
import { Typography, TableContainer, Table, TableRow, TableCell, Paper, Box, Link } from '@mui/material';

const BasicStats = ({ data }) => {
  return (
    <Paper elevation={3} sx={{ margin: 'auto', overflow: 'hidden', p: 2 }}>
      <Box sx={{ bgcolor: 'primary.main', p: 1 }}>
        <Typography variant="subtitle1" sx={{ color: 'common.white', textAlign: 'center' }}>Basic Statistics</Typography>
      </Box>
      <TableContainer>
        <Table aria-label="Basic Stats Table">
          <TableRow>
            {Object.entries(data).map(([key, value]) => (
              <TableCell key={key} component="th" scope="row">
                {key}: {value}
              </TableCell>
            ))}
          </TableRow>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default BasicStats;
